            OSIS.PEPPAM.BOM.Registro_Preguntas_CataCollection ret = OSIS.PEPPAM.BOM.Registro_Preguntas_CataCollection.PageLoadAllPaging(1, 1000000,searchString, null);

	            totalCount = ret.TotalRowCount;
            if (ret == null)
            {
                return new List<OSIS.PEPPAM.Mvc.Models.Registro_Preguntas_CataModel>();
            }

            var result = ret.Select(
                _registroPreguntasCata =>
                    new OSIS.PEPPAM.Mvc.Models.Registro_Preguntas_CataModel()
                    {
                Pregunta_Secuencia = _registroPreguntasCata.Pregunta_Secuencia,
                Respuesta_Secuencia = _registroPreguntasCata.Respuesta_Secuencia,
                Pregunta_Descripcion = _registroPreguntasCata.Pregunta_Descripcion,
                Registro_Estado = _registroPreguntasCata.Registro_Estado,
                Registro_Fecha = _registroPreguntasCata.Registro_Fecha,
                Registro_Usuario = _registroPreguntasCata.Registro_Usuario,

                    }).ToList();

            return result;
        }

	} 
